package DAY19Programmes;

public class FactorialNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
	
	
		
		int num=0;
		
		long factorial=1;
		
		for(int i=1;i<=num;i++)
		{
			factorial=factorial*i;
		}

		System.out.println("Factorial Number is :"+factorial);
		
	}

}
